import React from "react";
import ReactDom from "react-dom";

const TodoList = () => {
    return (
        <ul>
            <li>Learn React</li>
            <li>Build Awesome App</li>
        </ul>
    );
};

const AppHeader = () => {
    return (<h1>My Todo List</h1>);
};

const SearhPanel = () => {
    return (<input placeholder="search"/>);
};

const el = (
    <div>
        <AppHeader />
        <SearhPanel />
        <TodoList />

    </div>
);

ReactDom.render (el, document.getElementById("root"));
